import s from './MyPosts.module.css';

const MyPosts = () => {
	return (
		<div>
			my  posts
			<div>
				<textarea></textarea>
				<button>Add post</button>
			</div>
			<div className={s.posts}>
				<div className={s.item}>
					<img src="https://static.dw.com/image/5011737_404.jpg" />
					post 1
						</div>
				<div className={s.item}>
					post 2
						</div>
			</div>
		</div>
	);
};

export default MyPosts;
